    t[5177] = "Der Befehl erwartet drei Parameter:\n1. Kunden-Eingabe-Tabelle\n2. Agenten-Eingabe-Tabelle\n3. Dateiname unter dem das Modell gespeichert werden soll.\nDie beiden Tabellennamen k\u00f6nnen, jeweils durch \"!\" abgetrennt\num den Namen der Tabelle innerhalb der Arbeitsmappendatei und um\ndie erste zu ber\u00fccksichtigende Spalte erg\u00e4nzt werden.\nDie Anrufertabelle kann beliebig viele Spalten enthalten.\nPro Spalte wird ein Kundentyp definiert.\nJede Spalte muss aus folgenden Zeilen bestehen:\n- Name des Kundentyps\n- 48 Zeilen f\u00fcr die Anzahlen an Anrufen pro Halbstundenintervall\n- Basispriorit\u00e4t des Kundentyps\n- Priorit\u00e4ts\u00e4nderung pro Wartesekunde\n- Priorit\u00e4ts\u00e4nderung bei Weiterleitungen\n- Mittlere Wartezeittoleranz\n- Wiederholwahrscheinlichkeit\n- Mittlerer Wiederholabstand\n- Beliebig viele weitere Zeilen, die angeben mit welcher Wahrscheinlichkeit Kunden dieses Typs nach einem Gespr\u00e4ch weitergeleitet werden (Reihenfolge entsprechend der Spaltenreihenfolge der Tabelle; leere Zeilen bedeuten, dass Kunden nicht zu dem jeweiligen Typ weitergeleitet werden)\nDie Agententabelle kann beliebig viele Spalten enthalten.\nPro Spalte wird eine Agentengruppe definiert.\nJede Spalte muss aus folgenden Zeilen bestehen:\n- Name der Gruppe bzw. des Skill-Levels\n- 48 Zeilen f\u00fcr die Agentenanzahlen pro Halbstundenintervall\n- Beliebig viele weitere Zeilen f\u00fcr die mittleren Bedienzeiten der Kundentypen (Reihenfolge entsprechend der Spaltenreihenfolge der Kundentabelle; leere Zeilen bedeuten, dass die Agentengruppe Kunden dieses Typs nicht bedienen kann)";
