    t[10699] = "Dies ist ein einfaches Beispielmodell. Es besteht aus:\n- Einer Anrufergruppe mit %s Erstanrufer pro Tag\n- Einem Callcenter mit einer Agentengruppe\n- Erstanrufer und Agenten sind gleichm\u00e4\u00dfig \u00fcber den Tag verteilt.\n- Weiterleitungen und Anrufwiederholungen finden nicht statt.\n\nDie Besonderheit dieses Modells besteht darin, dass es nur Eigenschaften enth\u00e4lt,\ndie mit der Erlang-C-Formel angebildet werden k\u00f6nnen. Auch wird f\u00fcr die Bedienzeit-\nund die Wartezeittoleranzverteilung die Exponentialverteilung angenommen\n(lambda=%s, 1/mu=5, c=%s, 1/nu=15).\nDieses Modell ist damit wenig realistisch, aber gut analytisch beschreibbar.";
