    t[15188] = "Example.VeryLarge.Description";
    t[15189] = "Dies ist ein komplexes Beispielmodell. Es besteht aus:\n- 8 Anrufergruppen (insgesamt 300.000 Erstanrufer pro Tag)\n  - Normale Kunden: Thema A, Thema B, Thema C und Thema D\n  - Priorisierte Kunden: Thema A, Thema B, Thema C und Thema D\n  - Die priorisierten Kunden haben eine h\u00f6here Basisscore und eine h\u00f6here Score pro Wartesekunde.\n- 4 Callcenter mit jeweils ein oder zwei Agentengruppen\n  - Callcenter 1: Single-Skill f\u00fcr Thema A\n  - Callcenter 2: Single-Skill f\u00fcr Thema B\n  - Callcenter 3: Multi-Skill f\u00fcr alle Themen (A+B+C+D)\n  - Callcenter 4: Single-Skill f\u00fcr Thema A Multi-Skill f\u00fcr die Themen C+D\n- Da die Multi-Skill Agenten langsamer sind, werden Callcenter 1+2 priorisiert.\n- Mit der Agentenanzahl wird die Verteilung der Erstanrufer nach modelliert.\n- Weiterleitungen und Anrufwiederholungen nach Warteabbr\u00fcchen sind im Modell enthalten.";
