    t[15793] = "Werden f\u00fcr die zu optimierende Zielgr\u00f6\u00dfe zwei Grenzen angegeben, so wird zun\u00e4chst versucht,\ndie prim\u00e4re Grenze zu erf\u00fcllten. Im Anschluss daran wird (bei einer intervallbasierenden\nOptimierung in den Intervallen, in denen f\u00fcr die erste Grenze keine Anpassungen notwendig\nwaren) versucht, die Agentenzahlen so weit zu reduzieren, um die zweite Vorgabe einzuhalten.\nIm Ergebnis kann dies dazu f\u00fchren, dass f\u00fcr manche Intervalle jeweils nur eine der beiden\nGrenzen eingehalten wird. Dies gilt insbesondere, wenn beide Grenzen dicht beieinander liegen.";
